import axios from "axios";

import "./custom.css";

// App
export default function App() {
  const [plants, setPlants] = useState([]);

  console.log()

  useEffect(() => {
    axios.get("/api/plants")
    .then((res)=>res.json)
    .then((plants) => {
      console.log(plants)
      setPlants({plants: plants})
      console.log(plants)
    });
  }, [])

  return (
    <div>
      <section className="nav">
        <Header />
      </section>
